import React from 'react';

export default class Presentation extends React.Component {

constructor() {
    super();
    this.state = {
        load:false,
        resentation:[]
        }
}

componentDidMount() {
    const _this = this;
    axios.post('https://2xhclrt4yl.execute-api.us-east-1.amazonaws.com/stage/getpresentationall')
      .then(function (response) {
        _this.setState({
          load:true,
          resentation: response.data
        });
      }).catch(function (error) {
        console.log(error);
        _this.setState({
          error: error
        })
      })
  }

render() {
    return (
      <div className="main"  >
        <div className="main-container">
        <div className="archive-list-area"></div>
         
        </div>
      </div>
    );
  }
}
